import React from "react";
import ExpenseItem from './ExpenseItem'
const ExpenseList = (props) => {
    let expensesConstant = <p className="text-white">No items found</p>

    if (props.item.length > 0) {
      expensesConstant = props.item.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))
    };
}

export default ExpenseList;
